import React, { useState, useEffect } from 'react'
import './index.css'
import logo from '../../assets/images/moyyn.png'

import ItemUser from '../../components/ItemUser'
import api from '../../services/api';


function Users_list(){

    const [users, setUsers] = useState(0);

    useEffect(()=>{
        api.get('users').then(async(response) =>{
            const total = await response.data;
            setUsers([...total]);
            //console.log("aaa",total);
        })
    },[]);


    console.log("bbb",users);



    return(


        <div className="body">
            <header id="navigation-bar">
                    <img src={logo} alt="Logo" className="logo"/>
                    <div id="top-nav-container">
                        <a href="#home">Home</a>
                        <a href="#news">News</a>
                        <a href="#contact">Contact</a>
                        <a href="#about">About</a>
                    </div>
                </header>

                <main>

                    {console.log("a")}

                    {/* {users.length === 0 && (<div>Loading...</div>)} */}



                    {/* {users.map((user_item,index) =>{
                        return(
                            <ItemUser user={user_item}/>
                        )
                    })} */}





                </main>
        </div>
    )
}

export default Users_list;
